import { SkillAreaID } from '@/lib/content-types';
import { Path, G, Circle } from '@react-pdf/renderer';
import { getFillColor } from '../utils';

const Icon = ({ skillArea }: { skillArea: SkillAreaID }) => {
  switch (skillArea) {
    case 'know-yourself':
      return <KnowYourself />;
    case 'competence-first':
      return <CompetenceFirst />;
    case 'ready-for-change':
      return <ReadyForChange />;
    case 'world-around-you':
      return <WorldAroundYou />;
    case 'together-ahead':
      return <TogetherAhead />;
    case 'anticipate-the-future':
      return <AnticipateTheFuture />;
  }
};

export const PDFSkillAreaIcon = ({ skillArea, size }: { skillArea: SkillAreaID; size: number }) => {
  const circleSize = 188; // ref to scale against, the circle should be this big to have the inner icon same size as in normal icons. Cant use nested svg elements in react pdf so no viewbox to scale

  return (
    <G transform={`scale(${size / circleSize})`}>
      <Circle cx={circleSize / 2} cy={circleSize / 2} r={circleSize / 2} fill={getFillColor(skillArea)} />
      <G transform={`translate(${circleSize * 0.22}px, ${circleSize * 0.22}px)`}>
        <Icon skillArea={skillArea} />
      </G>
    </G>
  );
};

